The complement of set B with respect to set A, denoted as A\B or A - B, is the set of all elements in A that are not in B.

A = {1, 2, 3, 4, 5}
B = {2, 3, 6}

A\B = {1, 4, 5}

Now, let's prove that this complement is unique. 

Proof by contradiction:

Assume there exists another set C such that C is also the complement of B with respect to A, and C is not equal to A\B.

Since C is the complement of B with respect to A, it must contain all elements in A that are not in B. Therefore, C must also contain elements {1, 4, 5}.

Now, if C is not equal to A\B, then there must exist at least one element in C that is not in A\B or vice versa. However, this would contradict the fact that C contains all elements in A that are not in B, as A\B already contains all such elements.

Therefore, our assumption that there exists another set C that is the complement of B with respect to A and is not equal to A\B is false. This proves that the complement of set B with respect to set A, A\B, is unique.
